.uploader-file-info {
  display: flex;
  align-items: center;
  justify-content: space-between;
  .uploader-file-actions {
    width: 50px;
    padding-right: 5px;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    .actions-icon {
      color: #606266;
      opacity: 0.8;
      cursor: pointer;
      margin-left: 6px;
      font-size: 14px;
      display: block;
    }
    .el-icon-close {
      display: block;
      position: static;
    }
  }
  .uploader-file-status {
    width: 150px !important;
    text-indent: 10px !important;
    em {
      margin: 0 5px;
    }
  }
}
.uploader-file-name {
  width: calc(100% - 200px);
  text-indent: 0px !important;
  padding-left: 4px;
  padding-right: 10px;
  .el-icon-paperclip {
    margin-right: 7px;
    line-height: 25px;
  }
}
.uploader-file-size {
  width: 13%;
  text-indent: 10px;
}
.uploader-file-meta {
  width: 8%;
}
